def postcodeDictionary(postcodeList):
    postcodeDict = dict()
    counter = 1
    
    for i in postcodeList:
    
        iDict = {'postal town' : i}
    
        postcodeDict.update({counter : iDict})
        counter = counter + 1

    return postcodeDict
